import React from 'react';
import styled from 'styled-components';
import { useState } from 'react';
import bgImage from './fondo_iush.jpg'; // Ruta correcta de tu imagen
import bgbImage from './fondo_login.jpg';

const BackgroundImage = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-image: url(${bgbImage});
    background-size: cover;
    background-position: center;
    opacity: 0.4;
`;

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    position: relative;
`;

const FormContainer = styled.div`
    width: 90%; /* Ajuste el ancho del formulario a un 90% del contenedor */
    max-width: 600px; /* Máximo ancho del formulario para pantallas grandes */
    max-height: 80vh;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow-y: auto; /* Habilita el desplazamiento vertical */
    /* Estilos responsivos */
    @media (max-width: 768px) {
        width: 95%;
    }
    @media (max-width: 480px) {
        width: 100%;
        padding: 10px;
    }
`;

const Title = styled.h1`
    text-align: center;
    font-family: 'Hint Vadodara', sans-serif;
    margin-bottom: 20px;
`;

const Form = styled.form`
    display: flex;
    flex-direction: column;
    gap: 10px;
`;

const Label = styled.label`
    font-family: 'Hint Vadodara', sans-serif;
`;

const Input = styled.input`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
    background-color: #f9f9f9; /* Color de fondo *
`;

const Select = styled.select`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
`;

const Button = styled.button`
    padding: 10px;
    background-color: #67157D;
    color: white;
    border: none;
    border-radius: 20px;
    cursor: pointer;
    font-family: 'Hint Vadodara', sans-serif;
    margin-top: 20px;
`;

const Option = styled.option`
padding: 10px;
border: 1px solid #ccc;
border-radius: 20px;
font-family: 'Hint Vadodara', sans-serif;
background-color: #67157D; /* Color de fondo */
width: 50%;
`;


const FormPage = ({navigate}) => {
    const handleInicioClick = () => {
        navigate('home');
    };

    const [formData, setFormData] = useState({});

    const handleChange = (e) => {
        const { id, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [id]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Procesar los datos del formulario
        const processedData = {
            ok: true,
            data: {
                _id: "668c61018d8f55efe288c3e6", // Generar o recuperar este ID según tu lógica
                nombreEmprendimiento: formData.nombreEmprendedor || '', // Ajustar según tu lógica
                idSector: "6670ce4c7acec2e5e71a96d6", // Ajustar según tu lógica
                idEmprendedor: "667122b65ba165739d204893", // Ajustar según tu lógica
                fecha: new Date().toISOString().split('T')[0], // Fecha actual en formato yyyy/mm/dd
                respuestas: Object.keys(formData)
                    .filter(key => key.startsWith('pregunta'))
                    .map((key, index) => ({
                        idPregunta: key, // Ajustar según tu lógica de ID de preguntas
                        respuestaPregunta: formData[key] === 'si',
                        _id: `668c61018d8f55efe288c3e${7 + index}`
                    }))
            },
            message: "Creado con éxito",
            error: null
        };

        // Imprimir los datos procesados en la consola
        console.log('Datos del formulario procesados:', JSON.stringify(processedData, null, 2));

        // // Enviar los datos al servidor (comentado)
        // try {
        //     const response = await fetch('http://localhost:5000/api/enviarFormulario', {
        //         method: 'POST',
        //         headers: {
        //             'Content-Type': 'application/json'
        //         },
        //         body: JSON.stringify(processedData)
        //     });

        //     if (response.ok) {
        //         const data = await response.json();
        //         console.log('Formulario enviado exitosamente:', data);
        //     } else {
        //         console.error('Error al enviar el formulario:', response.statusText);
        //     }
        // } catch (error) {
        //     console.error('Error al enviar el formulario:', error);
        // }
    };

    return (
    <div>
        <BackgroundImage />
        <Container>

        <FormContainer>
            <Title>Registro de emprendimientos</Title>
            <Form onSubmit={handleSubmit}>
                <Label>Nombre del emprendedor</Label>
                <Input id="nombreEmprendedor" type="text" placeholder="Ingresa tu nombre" value={formData.nombreEmprendedor || ''} onChange={handleChange} required />

                <Label>Nacionalidad</Label>
                <Input id="nacionalidad" type="text" placeholder="Ingresa tu nacionalidad" value={formData.nacionalidad || ''} onChange={handleChange} required />

                <Label>Ciudad de residencia</Label>
                <Input id="ciudadResidencia" type="text" placeholder="Ingresa tu ciudad de residencia" value={formData.ciudadResidencia || ''} onChange={handleChange} required />

                <Label>Documento de identidad</Label>
                <Input id="documentoIdentidad" type="text" placeholder="Ingresa tu documento de identidad" value={formData.documentoIdentidad || ''} onChange={handleChange} required />

                <Label>Correo electrónico personal</Label>
                <Input id="correoPersonal" type="email" placeholder="Ingresa tu correo electrónico personal" value={formData.correoPersonal || ''} onChange={handleChange} required />

                <Label>Correo electrónico institucional</Label>
                <Input id="correoInstitucional" type="email" placeholder="Ingresa tu correo electrónico institucional" value={formData.correoInstitucional || ''} onChange={handleChange} required />

                <Label>Teléfono</Label>
                <Input id="telefono" type="text" placeholder="Ingresa tu teléfono" value={formData.telefono || ''} onChange={handleChange} required />

                <Label>Nombre de la institución a la que pertenece</Label>
                <Input id="nombreInstitucion" type="text" placeholder="Ingresa el nombre de la institución" value={formData.nombreInstitucion || ''} onChange={handleChange} required />

                <Label>Programa académico al que pertenece</Label>
                <Select id="programaAcademico" value={formData.programaAcademico || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="programa1">Programa 1</Option>
                    <Option value="programa2">Programa 2</Option>
                    <Option value="programa3">Programa 3</Option>
                    <Option value="programa4">Programa 4</Option>
                </Select>

                <Label>Sector o industria del emprendimiento</Label>
                <Select id="sectorIndustria" value={formData.sectorIndustria || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="tecnologia">Tecnología</Option>
                    <Option value="salud_bienestar">Salud y Bienestar</Option>
                    <Option value="educacion">Educación</Option>
                    <Option value="alimentos_bebidas">Alimentos y Bebidas</Option>
                    <Option value="moda_belleza">Moda y Belleza</Option>
                    <Option value="energia_medio_ambiente">Energía y Medio Ambiente</Option>
